import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Person name='Modestas' age="5" />
        <Person name='Tadas' age="55" />
        <Person name='Tomas' age="40" />
      </div>
    );
  }
}

export default App;
